import unittest
import fastq as fq
from Bio import SeqIO


class TestPreprocessor(unittest.TestCase):

	# TEST CASES FOR GET_READS() FUNCTION
    
	def get_reads(self, fastq1, fastq2):
		short_reads_1 = {
            read.getHead()[1:]: (read.getSeq(), read.getQual())
            for read in fq.read(fastq1)
        }
		short_reads_2 = {
			read.getHead()[1:]: (read.getSeq(), read.getQual())
			for read in fq.read(fastq2)
		}
		
		reads_1 = {
			read_id: seq_qual[0] for read_id, seq_qual in short_reads_1.items()
		}
		quals_1 = {
			read_id: list(seq_qual[1])
			for read_id, seq_qual in short_reads_1.items()
		}
		reads_2 = {
			read_id: seq_qual[0] for read_id, seq_qual in short_reads_2.items()
		}
		quals_2 = {
			read_id: list(seq_qual[1])
			for read_id, seq_qual in short_reads_2.items()
		}
		return reads_1, quals_1, reads_2, quals_2
	

	def test_get_reads_simple_genome(self):
		reads_1, quals_1, reads_2, quals_2 = self.get_reads("test_data/test_reads_1.fastq", "test_data/test_reads_2.fastq")
		self.assertEqual(reads_1, {'S0R001/1': 'AAA', 'S0R001/2': 'TTTTTCCCCC', 'S0R001/3': 'AAAAATTTTTCCCCC', 'S0R002/1': 'TTTAT', 'S0R002/2': 'TTCAG'})
		self.assertEqual(quals_1, {'S0R001/1': ['$', '$', '$'], 'S0R001/2': ['$', '$', '$', '$', '$', '$', '$', '$', '$', '$'], 'S0R001/3': ['$', '$', '$', '$', '$', '$', '$', '$', '$', '$', '$', '$', '$', '$', '$'], 'S0R002/1': ['$', '$', '$', '$', '$'], 'S0R002/2': ['$', '$', '$', '$', '$']})
		
	def test_get_reads_edge_cases(self):
		reads_1, quals_1, reads_2, quals_2 = self.get_reads("test_data/test_reads_1.fastq", "test_data/testi_reads_2.fastq")
		self.assertEqual(reads_2, {'S0R003/1': '', 'S0R003/2': 'T', 'S0R003/3': 'GGGGG', 'S0R003/4': 'ACTGACTG', 'S0R003/5': 'GGGGGCCCCCTTTTTAAAAA'})
		self.assertEqual(quals_2, {'S0R003/1': [], 'S0R003/2': ['$'], 'S0R003/3': ['$', '$', '$', '$', '$'], 'S0R003/4': ['$', '$', '$', '$', '$', '$', '$', '$'], 'S0R003/5': ['$', '$', '$', '$', '$', '$', '$', '$', '$', '$', '$', '$', '$', '$', '$', '$', '$', '$', '$', '$']})

        
	# TEST CASES FOR BUILD_SUFFIX_ARRAY() FUNCTION
        
	def build_suffix_array(self, reference_genome):
		return sorted(range(len(reference_genome)), key=lambda x: reference_genome[x:])
	

	def test_suffix_array_empty_string(self):
		self.assertEqual(self.build_suffix_array(""), [])

	def test_suffix_array_single_char(self):
		self.assertEqual(self.build_suffix_array("A"), [0])

	def test_suffix_array_banana(self):
		self.assertEqual(self.build_suffix_array("BANANA$"), [6, 5, 3, 1, 0, 4, 2])

	def test_suffix_array_simple_genome(self):
		self.assertEqual(self.build_suffix_array("ATGC$"), [4, 0, 3, 2, 1])
	
	def test_suffix_array_repeating_genome(self):
		self.assertEqual(self.build_suffix_array("AAAAA$"), [5, 4, 3, 2, 1, 0])

	def test_suffix_array_complex_genome(self):
		self.assertEqual(self.build_suffix_array("AACGATAGCGGTAGA$"), [15, 14, 0, 1, 12, 6, 4, 2, 8, 13, 3, 7, 9, 10, 11, 5])

